import React, { useState } from "react";
import {
    TextField,
    Button,
    Typography,
    Container,
    Box,
    Grid,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
} from "@mui/material";
import Pagination from "@mui/material/Pagination";

const AddStudent = () => {
    // State for student details
    const [students, setStudents] = useState([]);
    const [name, setName] = useState("");
    const [regNumber, setRegNumber] = useState("");
    const [standard, setStandard] = useState("");
    const [dob, setDob] = useState("");
    const [classTeacher, setClassTeacher] = useState("");
    const [yearOfJoining, setYearOfJoining] = useState("");
    const [page, setPage] = useState(1);

    // Number of items per page
    const rowsPerPage = 5;

    const handleSubmit = (e) => {
        e.preventDefault();
        const newStudent = {
            id: students.length + 1,
            name,
            regNumber,
            standard,
            dob,
            classTeacher,
            yearOfJoining,
        };

        setStudents([...students, newStudent]);
        setName("");
        setRegNumber("");
        setStandard("");
        setDob("");
        setClassTeacher("");
        setYearOfJoining("");
    };

    // Pagination logic
    const handleChangePage = (event, value) => {
        setPage(value);
    };

    const displayStudents = students.slice((page - 1) * rowsPerPage, page * rowsPerPage);

    return (
        <Container>
            <Typography variant="h4" gutterBottom align="center">
                Add Student
            </Typography>

            <form onSubmit={handleSubmit}>
                <Box mb={2}>
                    <Grid container spacing={3} justifyContent="center">
                        {/* Column 1 */}
                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Name"
                                fullWidth
                                value={name}
                                onChange={(e) => setName(e.target.value)}
                                required
                            />
                        </Grid>

                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Reg Number"
                                fullWidth
                                value={regNumber}
                                onChange={(e) => setRegNumber(e.target.value)}
                                required
                            />
                        </Grid>

                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Standard"
                                fullWidth
                                value={standard}
                                onChange={(e) => setStandard(e.target.value)}
                                required
                            />
                        </Grid>

                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Date of Birth"
                                fullWidth
                                type="date"
                                value={dob}
                                onChange={(e) => setDob(e.target.value)}
                                InputLabelProps={{
                                    shrink: true,
                                }}
                                required
                            />
                        </Grid>

                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Class Teacher"
                                fullWidth
                                value={classTeacher}
                                onChange={(e) => setClassTeacher(e.target.value)}
                                required
                            />
                        </Grid>

                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Year of Joining"
                                fullWidth
                                type="number"
                                value={yearOfJoining}
                                onChange={(e) => setYearOfJoining(e.target.value)}
                                required
                            />
                        </Grid>
                    </Grid>
                </Box>

                <Box mt={2} display="flex" justifyContent="center">
                    <Grid container spacing={2} justifyContent="center">
                        {/* Add Student Button */}


                        {/* Cancel Button */}
                        <Grid item xs={12} sm={6} md={4}>
                            <Button
                                variant="contained"
                                color="primary"
                                fullWidth
                                onClick={() => {/* Handle Cancel */}}
                                sx={{
                                    height: "100%",
                                    backgroundColor: "white",
                                    borderColor: "#B0B0B0", // Light gray border
                                    color: "#000", // Black text
                                    '&:hover': {
                                        backgroundColor: "#F5F5F5", // Light gray background on hover
                                        borderColor: "#B0B0B0", // Keep border color same on hover
                                    },
                                }}
                            >
                                Cancel
                            </Button>
                        </Grid>
                        <Grid item xs={12} sm={6} md={4}>
                            <Button
                                variant="contained"
                                color="primary"
                                fullWidth
                                type="submit"
                                sx={{ height: "100%" }}
                            >
                                Add Student
                            </Button>
                        </Grid>
                    </Grid>
                </Box>

            </form>




        </Container>
    );
};

export default AddStudent;
